import axios from 'axios';
import AxiosConfiguration from "../components/AxiosConfiguration";
import {axiosPrivate} from "../api/axios";
/*import useAxiosPrivate from "../hooks/useAxiosPrivate";*/
export class AplicacionService {



    getProductsSmall() {
        return axios.get('assets/demo/data/products-small.json').then(res => res.data.data);
    }

    getAplicacion() {
        // return axios.get('assets/demo/data/products.json').then(res => res.data.data);
      //  return axios.get('assets/demo/data/usuarios.json').then(res => res.data.data);
        return axiosPrivate.get('aplicacion/list').then(res => res.data);
      //  return axios.get('api/aplicacion/list',{'Authorization': `bearer ${token}`}).then(res => res.data.data);
    }
    postAplicacion(data){
        const datajs = JSON.stringify({
            "nombre":"SAEP6",
            "descripcion":"SISTEMA SAEP6",
            "version":"4.0",
            "uri":"HTTP://.."
        });
        console.log("datajs");
        console.log(datajs);
        return  axiosPrivate.post('aplicacion/create',datajs, {
            headers: {
                'Authorization': 'Basic xxxxxxxxxxxxxxxxxxx',
                'Content-Type': 'application/json'
            }
        }).then(res => res.data).catch(error => {
            //this.setState({ errorMessage: error.message });
            console.error('There was an error!', error);
        });;
    }

    getProductsWithOrdersSmall() {
        return axios.get('assets/demo/data/products-orders-small.json').then(res => res.data.data);
    }
}
